INSERT INTO `teeme_leaf` VALUES (1,0,0,'',0,2,'2015-11-24 03:29:45','2015-11-24 03:36:58','<p>Talked to Peter on phone. The meeting is confirmed for 5th Nov at 13:00 at their headoffice. Peter is just repleced the previous IT Director and is open to see others vendors partcipating for the pitch. He has given us 2 hours - our company',0,1,0,0,1,0,'publish'),(2,0,1,'',1,1,'2015-11-24 03:33:01','0000-00-00 00:00:00','<p>Done some due dilligent on BrightCo and Peter. He came from XYZ a networking compnay. BrightCo is looking to upgrade a lot op',0,1,0,0,2,0,'publish'),(3,0,1,'',1,2,'2015-11-24 03:36:29','0000-00-00 00:00:00','<p>Peter from XYZ has really good track record. A bit more hands on technical guy - confirm do we need to bring technical consultant in the meeting.</p>',0,1,0,0,3,0,'publish'),(4,0,0,'',0,2,'2015-11-24 03:38:44','2015-11-24 03:38:44','<p>Checked with Peter - we do need to bring networking engineers the initial focus is networking. Also wats us to present recent case studies.',0,1,0,0,4,0,'publish'),(5,0,1,'',1,2,'2015-11-24 04:36:42','2015-11-24 04:36:42','What is the main agenda for the meeting?',0,1,0,0,5,0,'publish'),(6,0,1,'',1,3,'2015-11-24 04:38:17','2015-11-24 04:38:17','<p>The main idea is to understand their plans for the systems upgrade. But we want to leave a good impression about Acme.</p>',0,1,0,0,6,0,'publish'),(7,0,1,'',1,1,'2015-11-24 04:41:33','2015-11-24 04:41:33','<p>Acme presentation - who are present for the meeting from our side? And thier roles in the meeting?</p>',0,1,0,0,7,0,'publish'),(8,0,1,'',1,1,'2015-11-24 04:42:08','2015-11-24 04:42:08','<p>How much time do we have for Acme presentation?</p>',0,1,0,0,8,0,'publish'),(9,0,1,'',1,3,'2015-11-24 04:44:03','2015-11-24 04:44:03','<p>I am thinking a short coprorate presentation - our capability in infrastructure projects. Woudl like to invite them to our office for current case studies and demos etc.</p>',0,1,0,0,9,0,'publish'),(10,0,1,'',1,3,'2015-11-26 01:01:08','2015-11-26 01:01:08','<p>Knowing Peter likes technical details - we should highlight our new technology capability.</p>',0,1,0,0,10,0,'publish'),(11,0,1,'',1,1,'2015-11-26 01:02:30','2015-11-26 01:02:30','<p>Small group - John, Paul and me?</p>',0,1,0,0,11,0,'publish'),(12,0,1,'',1,1,'2015-11-26 01:03:35','2015-11-26 01:03:35','<p>Acme - case studies? Can we include work done for Uni of Adelaide?</p>',0,1,0,0,12,0,'publish'),(13,0,1,'',1,1,'2015-11-26 01:04:14','2015-11-26 01:04:14','<p>Acme - Project Delivery - what do we need here?</p>',0,1,0,0,13,0,'publish'),(14,0,1,'',1,1,'2015-11-26 01:05:15','2015-11-26 01:05:15','<p>Acme - Financials - Do we have current years figures?</p>',0,1,0,0,14,0,'publish'),(15,0,1,'',1,3,'2015-11-26 01:06:30','2015-11-26 01:06:30','<p>Yes - I checked with Account Manager. Car dealership network has a good story.</p>',0,1,0,0,15,0,'publish'),(16,0,1,'',1,3,'2015-11-26 01:06:48','2015-11-26 01:06:48','<p>Our PMO and the certifications</p>',0,1,0,0,16,0,'publish'),(17,0,1,'',1,2,'2015-11-26 01:07:45','2015-11-26 01:07:45','No we need to go with last years. The current is not audited yet.',0,1,0,0,17,0,'publish'),(18,0,0,'',0,3,'2015-11-26 02:00:55','2015-11-26 02:00:55','<p>The first meeting went very well. BrightCo is open and actively seeking new technology partners. The Technology refresh program is the Boards approval is would be given substantial budget. The first Proposal is',0,1,0,0,18,0,'publish'),(19,0,0,'',0,3,'2015-11-26 02:05:26','2015-11-26 02:05:26','<p>General observations -',0,1,0,0,19,0,'publish'),(20,0,0,'',0,1,'2015-11-26 02:07:44','2017-01-16 11:23:04','<p>The BrightCo presentation should consist of -</p><ol><li>Company overview</li><li>Our understanding of BrightCo\'s requirements</li><li>Technical solution</li><li>Acme\'s Technical capability</li><li>Solution pricing</li><li>Conclusion</li></ol>',0,1,0,0,20,0,'publish'),(21,0,0,'',0,1,'2015-11-26 02:09:45','2015-11-26 02:09:45','<p>The first set of requiremnets are being finalized by this week. We have been given a draft to start working. This covers networking infrastructure. We have 3 weeks to respond.',0,1,0,0,21,0,'publish'),(22,0,0,'',0,1,'2015-11-26 02:11:34','2015-11-26 02:11:34','<p>The Acme presentation was well received. They were quite interested in the Uni of Adelaide case studies. Interested in seeing live demos etc.',0,1,0,0,22,0,'publish'),(23,0,0,'',0,1,'2015-11-26 02:13:54','2015-12-25 04:41:57','<p>Action items -</p><p><span style=\"background-color:#FFFF00\">(1) Organize detailed board room presentation with live demos.',0,1,0,0,23,0,'publish'),(24,0,1,'',1,1,'2015-11-26 02:18:22','0000-00-00 00:00:00','<p>Can we have a task tree to manage the first presentation.',0,1,0,0,24,0,'publish'),(25,0,1,'',1,3,'2015-11-26 02:19:36','0000-00-00 00:00:00','<p>Yes linked. Also we need a internal requirement analysis document - which will be used in teh Q&A session.</p>',0,1,0,0,25,0,'publish'),(26,0,1,'',1,2,'2015-11-26 02:20:24','0000-00-00 00:00:00','<p>Linked the document tree</p>',0,1,0,0,26,0,'publish'),(27,0,1,'',1,2,'2015-11-26 02:21:29','0000-00-00 00:00:00','<p>Any ideas on the budget they have prepared?</p>',0,1,0,0,27,0,'publish'),(28,0,1,'',1,2,'2015-11-26 02:36:43','2015-12-28 00:37:13','<p>Book BoardRoom with Smartboard for 4th Dec</p>',1,1,0,0,28,0,'publish'),(29,0,1,'',1,2,'2015-11-26 02:40:00','2016-03-10 00:30:52','<p>Finalise Corporate Presentation</p>',1,1,0,0,29,0,'publish'),(30,0,1,'',1,1,'2015-11-26 02:42:03','2015-11-26 02:42:03','<p>Case Studies - 4 in Total</p>',1,1,0,0,30,0,'publish'),(31,0,1,'',1,3,'2015-11-26 02:42:58','2015-11-26 02:54:52','<p>Live Demos</p>',1,1,0,0,31,0,'publish'),(32,0,1,'',1,1,'2015-11-26 02:44:44','2015-11-26 02:44:44','<p>Meeting with Acme',1,1,0,0,32,0,'publish'),(33,0,1,'',1,2,'2015-11-26 02:46:28','2015-11-26 02:48:13','<p>Board room setup</p>',1,1,0,0,33,0,'publish'),(34,0,1,'',1,3,'2015-11-26 02:50:59','2015-11-26 02:55:54','<p>Uni Of Adelaide</p>',1,1,0,0,34,0,'publish'),(35,0,1,'',1,3,'2015-11-26 02:51:22','2015-11-26 02:55:22','<p>Honda Dealer Network</p>',1,1,0,0,35,0,'publish'),(36,0,1,'',1,3,'2015-11-26 02:52:33','2015-11-26 02:52:33','<p>St John Hospital</p>',1,1,0,0,36,0,'publish'),(37,0,1,'',1,3,'2015-11-26 02:54:07','2015-11-26 02:54:07','<p>Axis Communications</p>',1,1,0,0,37,0,'publish'),(38,0,0,'',0,3,'2015-11-26 02:58:14','2015-11-26 02:58:14','<p>Meeting confirmed',0,1,0,0,38,0,'publish'),(39,0,1,'',1,1,'2015-11-26 03:00:09','0000-00-00 00:00:00','<p>Need approval from them before presentation</p>',0,1,0,0,39,0,'publish'),(40,0,1,'1',0,3,'2015-11-26 04:09:35','2015-11-26 04:09:35','<p>This documents consolidated BrightCo requirements in relation to the Networking proposal.</p>',0,1,0,0,40,0,'publish'),(41,0,1,'1',0,3,'2015-11-26 04:09:56','2015-11-26 04:09:56','<p>The current network</p>',0,1,0,0,41,0,'publish'),(42,0,1,'1',0,3,'2015-11-26 04:10:14','2015-11-26 04:10:14','<p>Current Network suppliers</p>',0,1,0,0,42,0,'publish'),(43,0,1,'1',0,1,'2015-11-26 04:11:15','2015-11-26 04:11:15','<p>The main outcomes required by the new',0,1,0,0,43,0,'publish'),(44,0,3,'',1,3,'2015-11-26 04:11:53','2015-11-26 04:11:53','<p>The main outcomes required by the new network.</p>',0,2,0,0,44,0,'publish'),(45,0,1,'1',0,1,'2015-11-26 04:13:28','2015-11-26 04:13:28','<p>gg</p>',0,1,0,0,45,0,'publish'),(46,0,3,'',1,1,'2015-11-26 05:12:18','2015-11-26 05:12:18','<p>This documents consolidates',0,2,0,0,46,0,'publish'),(47,0,3,'',1,2,'2015-11-26 05:14:45','2015-11-26 05:14:45','<p>The current network is the outcome of many stages of evolutions and upgardes. There has been 3 major vendors for the 3 different parts of the network and this is one of the main issues for any future consolidation.</p>',0,2,0,0,47,0,'publish'),(48,0,3,'',1,2,'2015-11-26 05:19:46','2015-11-26 05:19:46','<p>The main outcomes required by the new network is to support the following -</p><ol><li>Countrywide dealer network with video streaming capability.</li><li>Branch offices to support video conferencing to HQ.</li><li>Key personnel across country to have peer-to-peer video linkages.</li><li>All server consolidations to 2 locations - providing redundancies.</li><li>Online training/learning capability - to host and deliver.</li></ol>',0,3,0,0,48,0,'publish'),(49,0,1,'',1,2,'2015-11-26 05:20:38','0000-00-00 00:00:00','<p>Is this for networking side only? (scope of the document)</p><p>',0,1,0,0,49,0,'publish'),(50,0,1,'',1,1,'2015-11-26 05:21:11','0000-00-00 00:00:00','<p>Yes - thats right.</p>',0,1,0,0,50,0,'publish'),(51,0,1,'',1,2,'2015-11-26 05:25:04','0000-00-00 00:00:00','<p>How about the applications side?</p>',0,1,0,0,51,0,'publish'),(52,0,1,'',1,2,'2016-03-10 00:40:22','0000-00-00 00:00:00','<p>dd</p>',0,1,0,0,52,0,'publish'),(53,0,1,'',1,1,'2017-01-08 06:40:29','0000-00-00 00:00:00','<p>how about</p>',0,1,0,0,53,0,'publish'),(54,0,1,'',1,1,'2017-01-08 06:53:35','2017-01-08 06:53:35','<p>bvbbjbgb</p>',0,1,0,0,54,0,'publish'),(55,0,1,'',1,1,'2017-01-08 06:54:56','2017-01-08 06:54:56','<p>BTS DUbai campus</p>',0,1,0,0,55,0,'publish'),(56,0,1,'',1,1,'2017-01-13 12:14:14','0000-00-00 00:00:00','<p>Which products have been used?</p>',0,1,0,0,56,0,'publish'),(57,0,1,'1',0,1,'2017-01-14 12:58:10','2017-01-14 12:58:10','<p>The BrightCo proposal covers the technical solution, comparison of industry\'s best practices, costing and support requirements.</p>',0,1,0,0,57,0,'publish'),(58,0,3,'',1,1,'2017-01-14 13:07:39','2017-01-14 13:07:39','<p>The BrightCo proposal covers the technical solution, comparison of industry\'s best practices, costing and support requirements.</p><p>The detailed technical schematics is provided in Appendix 1.</p>',0,2,0,0,58,0,'publish'),(59,0,3,'',0,1,'2017-01-14 13:07:39','2017-01-14 13:07:39','<p>The BrightCo proposal covers the technical solution, comparison of industry\'s best practices, costing and support requirements.</p><p>The detailed technical schematics is provided in Appendix 1.</p>',0,1,0,0,59,0,'publish'),(60,0,1,'',1,2,'2017-01-15 06:54:26','2017-01-15 06:54:26','<p>The current figures are awaiting from the FC. Should be here in a week. Meanwhile I suggest to use the old figures.</p>',0,1,0,0,60,0,'publish'),(61,0,1,'',1,2,'2017-01-15 06:57:48','2017-01-15 06:57:48','<p>We should have both solutions person as well as network expert from our side. The meeting can turn very technical very soon.</p>',0,1,0,0,61,0,'publish'),(62,0,1,'',1,2,'2017-01-16 09:55:14','2017-01-16 09:55:14','<p>The following ....</p>',0,1,0,0,62,0,'publish'),(63,0,1,'',1,1,'2017-01-20 04:41:48','0000-00-00 00:00:00','<p>we have missed out ....</p>',0,1,0,0,63,0,'publish'),(64,0,1,'',1,1,'2017-01-20 04:54:26','2017-01-20 04:55:59','<p>Medical</p>',0,1,0,0,64,0,'publish'),(65,0,1,'',1,1,'2017-01-20 04:55:59','2017-01-20 04:55:59','<p>A kumar ...</p>',0,1,0,0,65,0,'publish'),(66,0,0,'',0,1,'2017-01-25 09:12:31','2017-01-25 09:12:31','<p>Received a call wants to talk to us urgently regarding the support</p>',0,1,0,0,66,0,'publish'),(67,0,0,'',0,1,'2017-01-25 09:14:09','2017-01-25 09:14:09','<p>meeting on 31 jan with to discuss</p>',0,1,0,0,67,0,'publish'),(68,0,1,'1',0,1,'2017-02-16 09:59:31','2017-02-16 09:59:31','<p>kjhsalkjhn jbkhbkwjbhnk lkjlkjlwdjn</p><p><br></p><h3>PDF]<a data-href=\\\"http://www.campbelltown.nsw.gov.au/files/assets/public/document-resources/builddevelop/planning-policies-and-controls/section94acontributionplansratesdec16cpi.pdf\\\" href=\\\"https://www.google.com.au/url?sa=t&rct=j&q=&esrc=s&source=web&cd=3&cad=rja&uact=8&ved=0ahUKEwi4577YkpTSAhWFHpQKHe3AB6IQFgglMAI&url=http%3A%2F%2Fwww.campbelltown.nsw.gov.au%2Ffiles%2Fassets%2Fpublic%2Fdocument-resources%2Fbuilddevelop%2Fplanning-policies-and-controls%2Fsection94acontributionplansratesdec16cpi.pdf&usg=AFQjCNGYy22Dd4mN4qLK6h41TH6FLzbG9w&sig2=Q1SdTAWEq2YR4h7lJTCl8Q&bvm=bv.147134024,d.dGo\\\">Current Section 94 Rates(132KB, PDF) - Campbelltown City Council</a></h3><p><cite>www.<strong>campbelltown</strong>.nsw