\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td></tr><tr><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\">add</td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td><td style=\\\"width: 14.2857%; background-color: rgb(0, 168, 133);\\\"><br></td></tr></tbody></table>',0,6,0,0,74,0,'publish'),(75,0,0,'',0,1,'2017-02-20 10:54:48','2017-02-20 10:54:48','<p>dddd</p>',0,1,0,0,75,0,'publish'),(76,0,0,'',0,1,'2017-03-06 06:47:12','2017-03-06 06:47:12','<p>Managing multicultural teams: What you should know | Forbes India                          </p><noscript>&amp;amp;amp;amp;amp;amp;lt;img src=\"http://b.scorecardresearch.com/p?c1=2&amp;amp;amp;amp;amp;amp;amp;c2=6683813&amp;amp;amp;amp;amp;amp;amp;cv=2.0&amp;amp;amp;amp;amp;amp;amp;cj=1\" /&amp;amp;amp;amp;amp;amp;gt;&amp;amp;amp;nbsp;</noscript><p> </p><!----><p> </p><!----><!--<noscript><div style=\"display:inline;\"><img data-fr-image-pasted=\"true\" height=\"1\" width=\"1\" style=\"border-style:none;\" alt=\"\" src=\"//googleads.g.doubleclick.net/pagead/viewthroughconversion/1015794932/?value=0&label=r54GCKzy1AMQ9Jmv5AM&guid=ON&script=0\"/></div></noscript>--><p> </p><section>So what is to be done? In order to try to shed some light on the issue, IESE professor Yih-Teen Lee and Minna Paunova of Copenhagen Business School looked at self-managed multicultural teams (working units made up of people from different cultures who are all responsible for executing a team task) in a nine month study. They found that especially when engaging with knowledge work, the fact these teams have a wide set of skills and viewpoints can help foster creativity. Whats more, having a wider range of capabilities allows them to serve a variety of client needs across different cultures..<br><br>But do they work? And how do they work best? The study highlights some practical tips which can help multicultural working groups can thrive. However, the short answer is: training makes a difference. The long answer is you don\'t need to have a Brazilian mom and an Indian dad with a Swiss education to contribute positively to multicultural teams\' success. In their study of 36 multinational teams (made up of over 250 MBA students from over 40 countries), they found that what\'s really critical</section>',0,1,0,0,76,0,'publish'),(77,0,0,'',0,1,'2017-03-06 06:47:37','2017-03-06 06:47:37','<p>Managing multicultural teams: What you should know | Forbes India                          </p><noscript>&amp;amp;amp;amp;amp;amp;lt;img src=\"http://b.scorecardresearch.com/p?c1=2&amp;amp;amp;amp;amp;amp;amp;c2=6683813&amp;amp;amp;amp;amp;amp;amp;cv=2.0&amp;amp;amp;amp;amp;amp;amp;cj=1\" /&amp;amp;amp;amp;amp;amp;gt;&amp;amp;amp;nbsp;</noscript><p> </p><!----><p> </p><!----><!--<noscript><div style=\"display:inline;\"><img data-fr-image-pasted=\"true\" height=\"1\" width=\"1\" style=\"border-style:none;\" alt=\"\" src=\"//googleads.g.doubleclick.net/pagead/viewthroughconversion/1015794932/?value=0&label=r54GCKzy1AMQ9Jmv5AM&guid=ON&script=0\"/></div></noscript>--><p> </p><section>The effects of a globalized world are nothing new. More and more often, we find ourselves working side by side colleagues from different cultures and countries or regularly Skyping with company-counterparts abroad. However, just because it is becoming common doesnt mean it is easy. International collaboration can be difficult. Oftentimes, colleagues must cross time zones, as well as language barriers and cultural divides. Just ask those who were betting on the DaimlerChrysler megamerger. The union ultimately failed, with many blaming the two companies\' cultural discord.<br><br>So what is to be done? In order to try to shed some light on the issue, IESE professor Yih-Teen Lee and Minna Paunova of Copenhagen Business School looked at self-managed multicultural teams (working units made up of people from different cultures who are all responsible for executing a team task) in a nine month study. They found that especially when engaging with knowledge work, the fact these teams have a wide set of skills and viewpoints can help foster creativity. Whats more, having a wider range of capabilities allows them to serve a variety of client needs across different cultures..<br><br>But do they work? And how do they work best? The study highlights some practical tips which can help multicultural working groups can thrive. However, the short answer is: training makes a difference. The long answer is you don\'t need to have a Brazilian mom and an Indian dad with a Swiss education to contribute positively to multicultural teams\' success. In their study of 36 multinational teams (made up of over 250 MBA students from over 40 countries), they found that what\'s really critical is fostering collective global leadership -- and having a team-learning orientation is a way to get there.<br><br><strong>Getting to know yourself better</strong><br>In their study, the authors predicted that multicultural teams would be positively influenced by a \"learning orientation.\" Learning-oriented individuals aren\'t afraid of failure and are eager to try new things. (In contrast, those who have a \"performance orientation\" are more eager to demonstrate their competence in current tasks.)<br><br>Anyone who has lived abroad can tell you that adapting to a different culture is a social learning process. The same is true in multicultural work environments. On a team level, the study confirmed that learning orientation can drive higher performance, efficacy, and commitment, as well as improved team dynamics. (At the same time, Lee and Paunova found that when team members are already willing to put group goals above their own individual glory, learning to be open is less important.)<br><br><strong>Leading without one leader</strong><br>For success, recent scholarship recommends that global leadership be distributed across multiple team members. This implies that team members are open to both offering and receiving guidance from all other team members, regardless of their culture or nationality.<br><br>When it works well, collective global leadership can boost team performance by driving greater effort and efficiency, as the Lee and Paunovas study confirmed for its MBA teams. Furthermore, shared responsibility improves the intra-team environment, allowing happier and more comfortable members to deliver improved results.<br><br><strong>Three Tips to Boost Team Performance</strong><br>So, is \"learning orientation\" a fixed trait, or can it be developed? The latter, say the authors, who offer three concrete tips to boost learning orientation, and thus collective leadership and performance, in multicultural teams:<br><br>   1. Hire learning-oriented team members. Learning orientation not only makes individual team members more leader-like, but also contributes to their effective participation in the global leadership process.<br>   2. Develop existing employees\' learning orientation. Implementing seminars and training tools designed to show that skills can be learned and that mistakes are a natural step in the learning process is key.<br>   3. Coach employees to adapt to multicultural teams. Organizational programs can teach people to feel safer, identify with their multicultural team, and to be more trusting of team members from other cultures.<br><br><br>In short, multicultural teams perform best when they have collective global leadership, supported by a positive team environment. To get there, having a learning orientation is crucial. Luckily learning orientation is not something you have to be born with  it is a trait that can be acquired and developed.<br><p>[This article has been reproduced with permission from IESE Business School. <a href=\"http://www.iese.edu/\" target=\"_blank\">www.iese.edu/</a> Views expressed are personal.]</p></section>',0,1,0,0,77,0,'publish'),(78,0,0,'',0,1,'2017-03-06 06:48:31','2017-03-14 09:22:53','<p>Managing multicultural teams: What you should know | Forbes India                          </p><noscript>&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;lt;img src=&amp;amp;amp;quot;http://b.scorecardresearch.com/p?c1=2&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;c2=6683813&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;cv=2.0&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;cj=1&amp;amp;amp;quot; /&amp;amp;amp;amp;amp;amp;amp;amp;amp;amp;gt;&amp;amp;amp;amp;amp;amp;amp;nbsp;</noscript><p> </p><!----><p> </p><!----><!--<noscript><div style=\"display:inline;\"><img data-fr-image-pasted=\"true\" height=\"1\" width=\"1\" style=\"border-style:none;\" alt=\"\" src=\"//googleads.g.doubleclick.net/pagead/viewthroughconversion/1015794932/?value=0&label=r54GCKzy1AMQ9Jmv5AM&guid=ON&script=0\"/></div></noscript>--><p> </p><section>For success, recent scholarship recommends that global leadership be distributed across multiple team members. This implies that team members are open to both offering and receiving guidance from all other team members, regardless of their culture or nationality.<br><br>When it works well, collective global leadership can boost team performance by driving greater effort and efficiency, as the Lee and Paunovas study confirmed for its MBA teams. Furthermore, shared responsibility improves the intra-team environment, allowing happier and more comfortable members to deliver improved results.</section><section><br></section><p>The middle of the para test - Failed. </p><section><br><br><strong>Three Tips to Boost Team Performance</strong><br>So, is \"learning orientation\" a fixed trait, or can it be developed? The latter, say the authors, who offer three concrete tips to boost learning orientation, and thus collective leadership and performance, in multicultural teams:<br><br>   1. Hire learning-oriented team members. Learning orientation not only makes individual team members more leader-like, but also contributes to their effective participation in the global leadership process.<br>   2. Develop existing employees\' learning orientation. Implementing seminars and training tools designed to show that skills can be learned and that mistakes are a natural step in the learning process is key.<br>   3. Coach employees to adapt to multicultural teams. Organizational programs can teach people to feel safer, identify with their multicultural team, and to be more trusting of team members from other cultures.<br><br><br>In short, multicultural teams perform best when they have collective global leadership, supported by a positive team environment. To get there, having a learning orientation is crucial. Luckily learning orientation is not something you have to be born with  it is a trait that can be acquired and developed.<br><p>[This article has been reproduced with permission from IESE Business School. <a href=\"http://www.iese.edu/\" target=\"_blank\">www.iese.edu/</a> Views expressed are personal.]</p></section><a download=\"audio_recording_1489483300978.mp3\" href=\"data:audio/mp3;base64,\">audio_recording_1489483300978.mp3</a><p><audio src=\"data:audio/mp3;base64,\" controls=\"\"></audio></p><a download=\"audio_recording_1489483338243.mp3\" href=\"data:audio/mp3;base64,\">audio_recording_1489483338243.mp3</a><p><audio src=\"data:audio/mp3;base64,\" controls=\"\"></audio></p>',0,1,0,0,78,0,'publish'),(79,0,0,'',0,1,'2017-03-08 07:13:44','2017-03-08 07:13:44','<p>Afte rthe first leaf .......</p>',0,1,0,0,79,0,'publish'),(80,0,0,'',0,1,'2017-03-08 09:58:57','2017-03-14 09:45:16','<p>test</p><table style=\"width: 100%;\"><tbod