-social-target=\\\"twitter\\\" href=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims#\\\" title=\\\"Tweet\\\"><span>Tweet</span></a></li><li>      </li><li><a data-article-url=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims\\\" data-gtm-event=\\\"socialShare\\\" data-gtm-eventaction=\\\"share\\\" data-gtm-eventinfo=\\\"eventAction,type,position\\\" data-gtm-position=\\\"top\\\" data-gtm-type=\\\"googlePlus\\\" data-social-target=\\\"google\\\" href=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims#\\\" title=\\\"Google+\\\">Google+</a></li><li>      </li><li><a data-gtm-event=\\\"socialShare\\\" data-gtm-eventaction=\\\"pin it\\\" data-gtm-eventinfo=\\\"eventAction,type,position\\\" data-gtm-position=\\\"top\\\" data-gtm-type=\\\"pin\\\" href=\\\"javascript%3Avoid((function(){var%20e=document.createElement(\\\'script\\\');e.setAttribute(\\\'type\\\',\\\'text/javascript\\\');e.setAttribute(\\\'charset\\\',\\\'UTF-8\\\');e.setAttribute(\\\'src\\\',\\\'https%3A//assets.pinterest.com/js/pinmarklet.js?r=\\\'+Math.random()*99999999);document.body.appendChild(e)})())\\\" title=\\\"Pin it\\\"><span>Pin it</span></a></li><li>      </li><li><a data-article-sitename=\\\"Wheels\\\" data-article-title=\\\"Dieselgate: Audi faces fresh cheat claims\\\" data-article-url=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims\\\" data-gtm-event=\\\"socialShare\\\" data-gtm-eventaction=\\\"email\\\" data-gtm-eventinfo=\\\"eventAction,type,position\\\" data-gtm-position=\\\"top\\\" data-gtm-type=\\\"email\\\" data-social-target=\\\"email\\\" href=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims#\\\" title=\\\"Email\\\">Email</a></li><li>    </li></ul><article><img alt=\\\"Audi sign\\\" src=\\\"https://d3lp4xedbqa8a5.cloudfront.net/imagegen/max/658/-/s3/digital-cougar-assets/wheels/2016/11/07/81857/Audi-sign.jpg\\\" class=\\\"fr-fic fr-dii\\\">        <p>German newspaper claims it has uncovered evidence of yet another emission cheat device in Audi-badged cars.</p><p>The Volkswagen Group is back in the <a href=\\\"https://www.wheelsmag.com.au/news/industry/1604/dieselgate-vw-presentation-outlined-cheats-in-2006-says-report\\\" target=\\\"_blank\\\">Dieselgate</a> spotlight after claims surfaced over the weekend that US authorities have uncovered yet another emissions cheat built in Audi vehicles.</p><p>German newspaper Bild am Sonntag reported that the US-based California Air Resources Board (CARB) engineers had uncovered the software cheat in an unspecified V6-engined Audi model fitted with an AL155 automatic transmission.</p><p>The cheat is believed to be linked to the cars electrically assisted steering system. According to the report, if the vehicle accelerates and the steering wheel doesnt move  a specific condition that will kick in if the emissions test is performed on a rolling road  the car switches the gearbox into a low-emissions mode.</p><p>The paper said applying torque to the steering wheel in potentially hundreds of thousands of vehicles would deactivate the cars warm up program, meaning the car would use more fuel and produce more emissions.</p><p>The cheat device is alleged to be present in models including the <a href=\\\"https://www.wheelsmag.com.au/reviews/1505/2015-audi-a6-allroad-quattro-review\\\" target=\\\"_blank\\\">Audi A6</a>, A8, and Q5.</p><p>Both CARB and Audi are yet to comment on the report.</p><p>Audi last month said it would set aside 752 million ($A1.09 billion) to cover the cost of recalls that will roll out for its V6 diesel engine caught up in the Dieselgate scandal.</p><p>According to Audi, a $US10 billion ($A13 billion) settlement reached with US authorities in July wont cover all the claims against the German luxury carmaker.</p><p><a href=\\\"https://www.wheelsmag.com.au/news/1609/volkswagen-to-fight-unnecessary-accc-proceedings\\\" target=\\\"_blank\\\">Volkswagen claims it has not broken any laws in Australia</a> relating to the emissions cheat it built into more than 90,000 cars sold here, and that it therefore does not need to compensate customers.</p><p>To date, Volkswagen Australia has issued only one recall to install new firmware on almost 9000 Amarok trade utes. Its <a href=\\\"http://volkswagendieselinfo.com.au/%20\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">Dieselgate website</a> has not been updated since a statement issued in June advising Australian owners that, unlike owners in the US, they would not be compensated for having been sold vehicles with the emissions cheat devices.</p><p>However, Australias consumer watchdog in September launched Federal Court action against Volkswagen Australia over the diesel engines scandal.</p><p>The <a href=\\\"https://www.wheelsmag.com.au/news/1606/car-retailers-under-investigation\\\" target=\\\"_blank\\\">Australian Competition and Consumer Commission</a> alleges Volkswagen Australia and its parent company engaged in multiple breaches of the Australian Consumer Law by concealing software in their vehicles to cheat emissions testing and misleading consumers about the vehicles compliance with standards and emission levels during on-road conditions.</p><p>The carmaker potentially faces millions of dollars in fines if the court sides with the ACCC.</p><p>The case has its next hearing scheduled for December 6.</p><p><strong>We\'re giving away the last <a href=\\\"https://www.wheelsmag.com.au/winholden\\\">great Aussie Holden V8!</a></strong> Enter here for your chance to win!</p><p><strong><a href=\\\"http://pages.s7.exacttarget.com/page.aspx?QS=38dfbe491fab00eaf0b8fb992ad1a0b52fb9e1dc0c154322&brand=wheels\\\" target=\\\"_blank\\\">Sign up here</a></strong><em>to receive the latest round-up of</em>Wheels<em>news, reviews and video highlights straight to your inbox each week.</em></p></article></section>',0,