138daf83339db32e3970d2f3996&referrer=http%3A%2F%2Fwww.msn.com%2Fen-au%2Fmoney%2Fmarkets%2Fthe-australian-dollar-is-looking-resilient-despite-concerns-about-the-job-market%2Far-BByoxzP%3Fli%3DAA54Gb%26ocid%3Dspartandhp\\\" class=\\\"fr-fic fr-dii\\\">                                                The Australian dollar is looking resilient despite concerns about the job market                      </p><main data-id=\\\"103\\\" data-m=\\\'{\\\"i\\\":103,\\\"n\\\":\\\"main\\\",\\\"y\\\":6}\\\' data-region=\\\"main\\\"><article data-aop=\\\"article\\\" tabindex=\\\"0\\\"><section data-aop=\\\"articlebody\\\" itemprop=\\\"articleBody\\\"><p>Australian dollar has opened the new trading week just below the 77 cent level.</p><p>Here\'s the early scoreboard as at 7.30am AEDT.</p><a href=\\\"https://0.r.bat.bing.com/?ld=d3RwuOfng2jAz4NCy45w0mrjVUCUwR0A_FHvx4PGdIIIbxiX-y9vAhTgMxmcxmVogffBiMYek1sY-ZouNib6-9nwLdN6pmG9rZM0i12a4jNMAzrtVTw39dRC09nW_2NhS327o1ITGt0k7fnhnciiGgch5jLnq8rr6vvK2r93qCW4bYMBor&u=www.torfx.com.au%2fppc%2fbest-exchange-rates.htm%3fadloc%3dBing%26utm_source%3dBing%26utm_medium%3dcpc%26utm_term%3dcurrencies%2520exchange%26adcmp%3dCurrency_Exchange_Bing%26admt%3db%26adsq%3dcommonwealth%2520bank%2520currency\\\" target=\\\"_blank\\\">Recommended for you:Currency Exchange $2K+ | TorFX.com.auTorFX.com.au/Best-Exchange-Rate|<span>Sponsored</span></a><ul><li><strong>AUD/USD</strong>0.7692,-0.0006,-0.08%</li><li><strong>AUD/JPY</strong>86.66,0.00,0.00%</li><li><strong>AUD/CNH</strong>5.2966,-0.0042,-0.08%</li><li><strong>AUD/EUR</strong>0.7164,-0.0005,-0.07%</li><li><strong>AUD/GBP</strong>0.6205,-0.0002,-0.03%</li><li><strong>AUD/NZD</strong>1.0957,-0.0006,-0.05%</li></ul><p>After the release of a weak <a href=\\\"https://www.businessinsider.com.au/australia-february-jobs-report-2017-3\\\" target=\\\"_blank\\\">February jobs report on Thursday last week</a>, something that initially pressured the Aussie lower, the currency has been well supported on any dip in recent trade courtesy of<a href=\\\"https://www.businessinsider.com.au/chart-perhaps-the-feds-updated-dot-plot-wasnt-that-dovish-after-all-2017-3\\\" target=\\\"_blank\\\">renewed weakness in the US dollar.</a></p><p>Elias Haddad, senior currency strategist at the Commonwealth Bank, expects that trend will likely continue this week.</p><p>\"We anticipate AUD/USD to edge a bit higher this week on firm iron ore prices and a softer USD,\" he wrote on Monday morning.</p><p>\"We see scope for the USD to correct modestly lower this week because there are no policy-relevant US economic data release and more substance from the Trump administrations fiscal stimulus roadmap is unlikely.</p><p>\"This means US interest rate expectations will not adjust higher which will weigh on USD,\" he says.</p><p>Turning to Monday trade in Asia, there are no major economic events or releases scheduled, likely ensuring that movements in the USD/JPY, US bond futures and Chinese commodity future will prove to be influential on the Aussie today.</p><p>There may be some passing interest in a speech from Luci Ellis, assistant governor at the RBA, who will speak before the Women in Economics Network in Canberra from 12.40pm AEDT. There is no title for the speech, and there will be a Q&A section following her official remarks.</p><p>Later in the session, there are no major events scheduled that appear likely to generate volatility in either the Aussie or currency markets in general.</p></section></article></main>',0,1,0,0,103,0,'publish'),(104,0,1,'',1,1,'2017-03-21 03:36:25','0000-00-00 00:00:00','<p>1st leaf</p><p><br></p>',0,1,0,0,104,0,'publish'),(105,0,1,'',1,1,'2017-03-21 03:36:34','0000-00-00 00:00:00','<p>ddd</p>',0,1,0,0,105,0,'publish'),(106,0,1,'',1,1,'2017-03-21 03:37:07','0000-00-00 00:00:00','<p>heights of talk winodws</p>',0,1,0,0,106,0,'publish'),(107,0,1,'',1,1,'2017-03-21 03:37:48','0000-00-00 00:00:00','<p>2nd comment<br></p>',0,1,0,0,107,0,'publish'),(108,0,1,'',1,1,'2017-03-21 03:45: