elsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims\\\" data-gtm-event=\\\"socialShare\\\" data-gtm-eventaction=\\\"email\\\" data-gtm-eventinfo=\\\"eventAction,type,position\\\" data-gtm-position=\\\"top\\\" data-gtm-type=\\\"email\\\" data-social-target=\\\"email\\\" href=\\\"https://www.wheelsmag.com.au/news/industry/1611/dieselgate-audi-faces-fresh-cheat-claims#\\\" title=\\\"Email\\\">Email</a></li><li>    </li></ul><article><img alt=\\\"Audi sign\\\" src=\\\"https://d3lp4xedbqa8a5.cloudfront.net/imagegen/max/658/-/s3/digital-cougar-assets/wheels/2016/11/07/81857/Audi-sign.jpg\\\" class=\\\"fr-fic fr-dii\\\">        <p>German newspaper claims it has uncovered evidence of yet another emission cheat device in Audi-badged cars.</p><p>The Volkswagen Group is back in the <a href=\\\"https://www.wheelsmag.com.au/news/industry/1604/dieselgate-vw-presentation-outlined-cheats-in-2006-says-report\\\" target=\\\"_blank\\\">Dieselgate</a> spotlight after claims surfaced over the weekend that US authorities have uncovered yet another emissions cheat built in Audi vehicles.</p><p>German newspaper Bild am Sonntag reported that the US-based California Air Resources Board (CARB) engineers had uncovered the software cheat in an unspecified V6-engined Audi model fitted with an AL155 automatic transmission.</p><p>The cheat is believed to be linked to the cars electrically assisted steering system. According to the report, if the vehicle accelerates and the steering wheel doesnt move  a specific condition that will kick in if the emissions test is performed on a rolling road  the car switches the gearbox into a low-emissions mode.</p><p>The paper said applying torque to the steering wheel in potentially hundreds of thousands of vehicles would deactivate the cars warm up program, meaning the car would use more fuel and produce more emissions.</p><p>The cheat device is alleged to be present in models including the <a href=\\\"https://www.wheelsmag.com.au/reviews/1505/2015-audi-a6-allroad-quattro-review\\\" target=\\\"_blank\\\">Audi A6</a>, A8, and Q5.</p><p>Both CARB and Audi are yet to comment on the report.</p><p>Audi last month said it would set aside 752 million ($A1.09 billion) to cover the cost of recalls that will roll out for its V6 diesel engine caught up in the Dieselgate scandal.</p><p>According to Audi, a $US10 billion ($A13 billion) settlement reached with US authorities in July wont cover all the claims against the German luxury carmaker.</p><p><a href=\\\"https://www.wheelsmag.com.au/news/1609/volkswagen-to-fight-unnecessary-accc-proceedings\\\" target=\\\"_blank\\\">Volkswagen claims it has not broken any laws in Australia</a> relating to the emissions cheat it built into more than 90,000 cars sold here, and that it therefore does not need to compensate customers.</p><p>To date, Volkswagen Australia has issued only one recall to install new firmware on almost 9000 Amarok trade utes. Its <a href=\\\"http://volkswagendieselinfo.com.au/%20\\\" rel=\\\"nofollow\\\" target=\\\"_blank\\\">Dieselgate website</a> has not been updated since a statement issued in June advising Australian owners that, unlike owners in the US, they would not be compensated for having been sold vehicles with the emissions cheat devices. Added from iPad.</p><p>However, Australias consumer watchdog in September launched Federal Court action against Volkswagen Australia over the diesel engines scandal.</p><p>The <a href=\\\"https://www.wheelsmag.com.au/news/1606/car-retailers-under-investigation\\\" target=\\\"_blank\\\">Australian Competition and Consumer Commission</a> alleges Volkswagen Australia and its parent company engaged in multiple breaches of the Australian Consumer Law by concealing software in their vehicles to cheat emissions testing and misleading consumers about the vehicles compliance with standards and emission levels during on-road conditions.</p><p>The carmaker potentially faces millions of dollars in fines if the court sides with the ACCC.</p><p>The case has its next hearing scheduled for December 6.</p><p><strong>We\'re giving away the last <a href=\\\"https://www.wheelsmag.com.au/winholden\\\">great Aussie Holden V8!</a></strong> Enter here for your chance to win!</p><p><strong><a href=\\\"http://pages.s7.exacttarget.com/page.aspx?QS=38dfbe491fab00eaf0b8fb992ad1a0b52fb9e1dc0c154322&brand=wheels\\\" target=\\\"_blank\\\">Sign up here</a></strong><em>to receive the latest round-up of</em>Wheels<em>news, reviews and video highlights straight to your inbox each week.</em></p></article></section>',0,2,0,0,119,0,'publish'),(120,0,1,'',1,1,'2017-03-22 14:14:48','2017-03-22 14:14:48','<p>testing</p>',0,1,0,0,120,0,'publish'),(121,0,1,'',1,1,'2017-03-22 14:15:02','2017-03-22 14:15:02','<p>second comment</p>',0,1,0,0,121,0,'publish'),(122,0,1,'',1,1,'2017-04-06 06:23:47','2017-04-26 08:20:12','<p>New Task</p>',1,1,0,0,122,0,'publish'),(123,0,1,'',1,1,'2017-04-06 06:26:16','2017-04-06 06:26:16','<p>EBIW topic</p>',0,1,0,0,123,0,'publish'),(124,0,1,'',1,1,'2017-04-06 06:27:10','2017-04-06 06:27:10','<p>c1</p>',0,1,0,0,124,0,'publish'),(125,0,0,'',0,1,'2017-04-06 06:30:58','2017-04-06 06:30:58','<p>I had a good meeting he wants to make the following changes .....</p>',0,1,0,0,125,0,'publish'),(126,0,1,'1',0,1,'2017-04-06 06:33:58','2017-04-06 06:33:58','<p>Technical Architecture</p>',0,1,0,0,126,0,'publish'),(127,0,3,'',1,1,'2017-04-06 06:34:55','2017-04-06 06:34:54','<p>Technical Architecture :</p><p>\\\\</p><p>These rea the 4 main modules ....</p>',0,2,0,0,127,0,'publish'),(128,0,1,'',1,1,'2017-04-19 13:28:15','2017-04-19 21:44:34','<p>First post from BrightCo.</p>',0,1,0,0,128,0,'publish'),(129,0,1,'',1,1,'2017-04-19 13:28:53','2017-04-19 13:28:53','<p>First comment</p>',0,1,0,0,129,0,'publish'),(130,0,1,'',1,2,'2017-04-19 20:56:10','2017-04-19 20:56:10','<p>Commmenting on previous c -</p><p><br></p>',0,1,0,0,130,0,'publish'),(131,0,1,'',1,1,'2017-04-19 21:40:58','2017-04-19 21:40:58','<p>Third one</p>',0,1,0,0,131,0,'publish'),(132,0,1,'',1,2,'2017-04-19 21:41:15','2017-04-19 21:41:15','4th',0,1,0,0,132,0,'publish'),(133,0,1,'',1,2,'2017-04-19 21:44:34','2017-04-19 21:44:34','<p>Would-be Australians will face tough new hurdles  including a new English language and \"Australian values\" test  and have to wait several more years before being eligible for citizenship, under a major shake-up of the migration program.</p><p>Migrants could be asked whether they support female genital mutilation and forced marriages, or whether it\'s acceptable to strike a spouse at home, under proposed values-based citizenship test questions to be put to the public for feedback.</p><p>Applicants will also have to demonstrate they have attempted to integrate into Australian society, providing evidence of a job, the enrolment of their children in school, and even membership of community organisations.</p><p>Under the current system, migrants enter Australia on a range of visas. They can then become permanent residents but have to wait a further year before applying for citizenship. The one-year wait will rise to four years under the redesigned scheme.</p><p>The new measures are the second tranche of changes to Australia\'s immigration system in less than a week. On Tuesday, Prime Minister Malcolm Turnbull and Immigration Minister Peter Dutton announced the 457 foreign worker visa program would be axed and replaced by an \"Australians first\" approach to skilled migration.</p><p>The two-step push underscores the Turnbull government\'s shift to the right on immigration and border protection, which has been driven in part by Mr Dutton and other leading conservatives. They will probably be welcomed by the conservative base of the Coalition and nationalist parties such as One Nation, but some sections of Australia\'s migrant communities could feel targeted.</p><p>The changes are due to take effect from Thursday, but they will have to pass both houses of Parliament, opening a fresh political fight with the Labor opposition and crossbenchers.</p><p>Mr Turnbull said the citizenship changes, to be announced on Thursday, would put \"Australian values at the heart of citizenship processes and requirements\".</p><p>\"Membership of the Australian family is a privilege and should be afforded to those who support our values, respect our laws and want to work hard by integrating and contributing to an even better Australia. We must ensure that our citizenship program is conducted in our national interest,\" Mr Turnbull said.</p><p>\"Any conduct that is inconsistent with Australian values will be considered as part of this process. Criminal activity including family violence or involvement in organised crime is thoroughly inconsistent with Australian values.\"</p><p>Mr Dutton said Australians \"shouldn\'t be embarrassed to say we want great people to call Australia home\".</p><p>\"We want people who abide by our laws and our values and we should expect nothing less,\" he said.</p><p>A third tranche of changes is expected and could include the creation of a \"provisional visa\" class which would tighten access to social security payments, as Fairfax Media revealed in November.</p><p>At present, citizenship applicants sit a 20-question test and must correctly answer at least 75 per cent. The quiz asks factual multiple-choice questions about Anzac Day, Australia\'s system of government and the colours of the Aboriginal flag.</p><p>The new quiz will not dump these questions, but \"values-based\" questions will be added to assess would-be citizens\' understanding of and commitment to \"Australian values\".</p><p>If a person fails three times, they will have to wait two years before trying again.</p><p>A stand-alone English language test examining reading, writing and listening skills will also be introduced.</p><p>A permanent resident has most of the same rights as an Australian citizen, though they must have a valid visa with authority to travel if they wish to return to Australia. They also can\'t vote in elections, unless they were enrolled to vote as a British subject before 1984.</p><p>Opposition Leader Bill Shorten on Wednesday said the 457 changes were \"already unravelling\", pointing to an analysis by the ALP that showed just 8.6 per cent of people currently on foreign worker visas were working in jobs that would be excluded under the new visa system. Mr Dutton disputed that claim.</p><p>About 7 million permanent migrants have settled in Australia since 1945. In 2014-15, 190,000 places were available for permanent migrants in Australia\'s immigration program.</p><p>Follow James Massola on Facebook</p>',0,1,0,0,133,0,'publish'),(134,0,1,'',1,1,'2017-04-26 01:45:34','0000-00-00 00:00:00','<p>meikodaip</p>',0,1,0,0,134,0,'publish'),(135,0,1,'',1,1,'2017-04-26 01:52:07','2017-04-26 01:52:07','<p>Meikodai presentation ..........</p>',0,1,0,0,135,0,'publish'),(136,0,1,'',1,1,'2017-04-26 01:53:33','2017-04-26 01:53:33','<p>started 10 am</p>',0,1,0,0,136,0,'publish'),(137,0,1,'',1,1,'2017-04-26 01:54:18','2017-04-26 01:54:18','<p>Evening plans ....</p>',0,1,0,0,137,0,'publish'),(138,0,1,'',1,1,'2017-04-26 01:54:50','2017-04-26 01:54:50','From ',0,1,0,0,138,0,'publish'),(139,0,1,'',1,1,'2017-04-26 08:17:37','2017-04-26 08:17:37','<p>Team meeting ....</p>',0,1,0,0,139,0,'publish'),(140,0,1,'',1,1,'2017-04-26 08:18:10','2017-04-26 08:18:10','rrrrr',0,1,0,0,140,0,'publish'),(141,0,1,'',1,1,'2017-07-17 15:58:57','2017-07-17 16:04:44','<p>new post added for sharing <br></p>',0,1,0,0,141,0,'publish'),(142,0,1,'1',0,1,'2017-07-17 16:02:28','2017-07-17 16:02:28','<p>new leaf create for testing<br></p>',0,1,0,0,142,0,'publish'),(143,0,1,'',1,5,'2017-07-17 16:04:08','2017-07-17 16:04:08','<p>new testing comment</p>',0,1,0,0,143,0,'publish'),(144,0,1,'',1,5,'2017-07-17 16:04:44','2017-07-17 16:04:44','agian comment for green sync icon',0,1,0,0,144,0,'publish'),(145,0,0,'',0,1,'2017-07-17 16:28:45','2017-07-17 16:28:45','<p>I