 and (as he admits) brought almost every DVD and Training Aid in a bid to improve his golf.</p><p>But no matter what he does...Nothing seems to work! Until now...</p><p>If you are struggling to improve your golf and no matter what you try nothing seems to be working for you then I strongly encourage you to listen to every word of this revolutionary lesson.</p><p>If the lesson resonates with you and you feel you have a deep rooted challenge that you just cant seem to shake then I am offering ten lucky golfers the opportunity to have a complementary 30 minute coaching session (similar to Mark\'s), valued at $197, with me.</p><p>To qualify you must watch the full lesson and leave a like and a comment below the lesson at<a data-saferedirecturl=\"https://www.google.com/url?q=https://click.mlsend.com/link/c/YT0xMjM5MzM5MjYyMTMwNzgzODEyJmM9cDR5MSZlPTE5MjgmYj0yNzUzMzUzMzAmZD1pN3gydjZn.uGFQJ-FjX4BvYbHz05WUN8tfVQLEFNL3FaA_TbcpKMk&source=gmail&ust=1567904607756000&usg=AFQjCNFeptZJT45TjeatgT4oHaZn99EAHg\" href=\"https://click.mlsend.com/link/c/YT0xMjM5MzM5MjYyMTMwNzgzODEyJmM9cDR5MSZlPTE5MjgmYj0yNzUzMzUzMzAmZD1pN3gydjZn.uGFQJ-FjX4BvYbHz05WUN8tfVQLEFNL3FaA_TbcpKMk\" target=\"_blank\"><strong>https://youtu.be/wwwGV50WdqU</strong></a>, you must also subscribe to the Golf University YouTube Channel<a data-saferedirecturl=\"https://www.google.com/url?q=https://click.mlsend.com/link/c/YT0xMjM5MzM5MjYyMTMwNzgzODEyJmM9cDR5MSZlPTE5MjgmYj0yNzUzMzUzMzImZD10OXkzcTdv.419qj2O7hPN7wMRRPTvI5GuiCsQXumUveliKyYnEUfA&source=gmail&ust=1567904607756000&usg=AFQjCNEb4fK8ymvKIPEE15ip-jgNGJtu8g\" href=\"https://click.mlsend.com/link/c/YT0xMjM5MzM5MjYyMTMwNzgzODEyJmM9cDR5MSZlPTE5MjgmYj0yNzUzMzUzMzImZD10OXkzcTdv.419qj2O7hPN7wMRRPTvI5GuiCsQXumUveliKyYnEUfA\" target=\"_blank\"><strong>HERE</strong></a> and the Golf Getaway YouTube Channel<a data-saferedirecturl=\"https://www.google.com/url?q=https://click.mlsend.com/link/c/YT0xMjM5MzM5MjYyMTMwNzgzODEyJmM9cDR5MSZlPTE5MjgmYj0yNzUzMzUzMzQmZD12N3EwbjV0.QBx7oUTJx