Use Expand and collapse icon for Task/Tags and Users</li><li>\"Your tasks\" change to Tasks<ol><li>In the task description add green or red icon for start/end time.</li><li>These should be hyperlinked</li><li>Only mark overdue by red color</li><li>What happens if I have assigned the task to multiple people?</li><li>Description change (discuss)</li></ol></li><li>\"Your action tags\" to \"Action Tags\"</li><li><br></li></ol>',0,1,0,0,772,0,'publish'),(773,0,1,'1',0,1,'2019-12-25 06:37:51','2019-12-25 06:37:51','<p>Task and Subtask - Delete behavior not correct. Only the content is deleted. Where as all elements should be deleted and side effects applied inn sorting - whether a task list becomes a Task if all subtasks deleted? [discuss]</p>',0,1,0,0,773,0,'publish'),(774,0,1,'1',0,1,'2019-12-25 12:15:16','2019-12-25 12:15:16','<p>cccc</p><p>cccc</p>',0,1,0,0,774,0,'discarded'),(775,0,1,'1',0,1,'2019-12-25 12:19:26','2019-12-25 12:19:26','<p>When the browser is maximized - this leaf could not be added as the bottom of the previous leaf could be be scrolled. The last leaf should be fully shown. This was added when the browser was not full screen.</p>',0,1,0,0,775,0,'publish'),(776,0,1,'1',0,1,'2019-12-25 12:22:40','2019-12-25 12:22:40','<p>It seems that the editor in edit mode has line spacing of more than 1 line. But the content is spaced 1 line. Check for the editor in all trees to confirm and fix - both when adding a new leaf and while editing a leaf.</p>',0,1,0,0,776,0,'publish'),(777,0,1,'',1,1,'2019-12-25 12:27:31','2019-12-25 12:27:31','<p>qqqq</p>',1,1,0,0,777,0,'publish'),(778,0,1,'',1,1,'2019-12-25 12:27:45','2019-12-25 12:27:45','<p>aaaa</p>',1,1,0,0,778,0,'publish'),(779,0,1,'1',0,1,'2019-12-25 12:35:41','2019-12-25 12:35:41','<p>Task History - not correct.</p><ol><li>It should display the previous task (can we show icons as well) and completion status if any.</li><li>I think it generates 2 events for 2 assignee.</li><li>The originator should be the last - we should be same as the task.</li><li>Test for Task becoming Task list etc.</li></ol>',0,1,0,0,779,0,'publish'),(780,0,3,'',1,1,'2019-12-25 12:43:16','2019-12-25 12:43:38','<p>Task Related -</p><ol><li>Subtask should also be sorted out like task in chronological sequence.</li><li>Task with end date (only) for example 25 Dec is shown below Task starting with 28th Dec.</li><li>For the sorting logic - factor that a task list may have end time prior to start time (due to 2 subtasks) - it should be treated accordingly. And should be sorted on end time in the task list as in the subtask list.</li><li>The default changes to 0900 and 1700 are happening the first time the UI shows. The behavior should be consistent for edits/ multiple edits/ removal of check boxes etc.</li><li>The Now time is inconsistent - it is not factoring daylight saving (or logic is not right). We can get the local time from browser used. Check this logic for other events as well such as create time/edit time etc.</li><li>By default - all task/subtask should be marked on calendar.</li></ol>',0,2,0,0,780,0,'publish'),(781,0,3,'',1,1,'2019-12-25 12:46:12','2019-12-25 12:46:44','<p>Task Related -</p><ol><li>Subtask should also be sorted out like task in chronological sequence.</li><li>Task with end date (only) for example 25 Dec is shown below Task starting with 28th Dec.</li><li>For the sorting logic - factor that a task list may have end time prior to start time (due to 2 subtasks) - it should be treated accordingly. And should be sorted on end time in the task list as in the subtask list.</li><li>The default changes to 0900 and 1700 are happening the first time the UI shows. The behavior should be consistent for edits/ multiple edits/ removal of check boxes etc.</li><li>The Now time is inconsistent - it is not factoring daylight saving (or logic is not right). We can get the local time from browser used. Check this logic for other events as well such as create time/edit time etc.</li><li>By default - all task/subtask should be marked on calendar.</li><li>Calendar view - Selecting Day view does not show the task.</li></ol>',0,3,0,0,781,0,'publish'),(782,0,3,'',1,1,'2019-12-25 12:48:41','2019-12-25 12:50:46','<p>Task Related -</p><ol><li>Subtask should also be sorted out like task in chronological sequence.</li><li>Task with end date (only) for example 25 Dec is shown below Task starting with 28th Dec.</li><li>For the sorting logic - factor that a task list may have end time prior to start time (due to 2 subtasks) - it should be treated accordingly. And should be sorted on end time in the task list as in the subtask list.</li><li>The default changes to 0900 and 1700 are happening the first time the UI shows. The behavior should be consistent for edits/ multiple edits/ removal of check boxes etc.</li><li>The Now time is inconsistent - it is not factoring daylight saving (or logic is not right). We can get the local time from browser used. Check this logic for other events as well such as create time/edit time etc.</li><li>By default - all task/subtask should be marked on calendar.</li><li>Calendar view - Selecting Day view does not show the task.</li><li>Discuss - difference in calendar from the task tree and from header. From the header it says Task/Calendar. Should the calendar be global? In future we could also mark action tags.</li></ol>',0,4,0,0,782,0,'publish'),(783,0,1,'',1,1,'2019-12-25 13:00:03','0000-00-00 00:00:00','<p>m,ns ,m,</p>',0,1,0,0,783,0,'publish'),(784,0,1,'',1,1,'2019-12-25 13:03:48','0000-00-00 00:00:00','<p>ccc</p>',0,1,0,0,784,0,'publish'),(785,0,1,'1',0,1,'2019-12-25 13:05:24','2019-12-25 13:05:24','<p>From Timeline events we can not navigate back -</p><ol><li>Task not highlighted from comments</li><li>Seed is not highlighted from Tag/Link/Talk</li></ol><p>Check from Notification as well.</p>',0,1,0,0,785,0,'publish'),(786,0,3,'',1,1,'2019-12-26 04:25:40','2019-12-26 04:31:16','<p>Task and Subtask - Delete behavior not correct [discuss]. Only the content is deleted. Where as all elements should be deleted and side effects applied in sorting:</p><p>- whether a task list becomes a Task if all subtasks deleted</p><p>- When the task is deleted - it should become untimed as well - thus removed from calendar and goes to the bottom of the task/subtask list</p><p>- The task sorting - timed/untimed/deleted</p><p>- Can we treat this as discarded leaf and not show at all?</p><p><br></p><p><br></p>',0,2,0,0,786,0,'publish'),(787,0,1,'',1,2,'2019-12-26 04:35:45','2019-12-26 17:08:30','<p>asdfasdf</p><p>asdf</p><p>asd</p><p>fasd</p><p>fsd</p><p>af</p><p>sdaf</p><p>asdfsdafasdf</p><p>asdfasdf</p><p>asdfasdfasdf</p><p>asdfasdfasdf</p><p><br></p><p>asdfasd</p><p>f</p><p>sd</p>',1,1,0,0,787,0,'deleted'),(788,0,3,'',1,1,'2019-12-26 04:42:21','2019-12-26 04:43:03','<p>Task and Subtask - Delete behavior not correct [discuss]. Only the content is deleted. Where as all elements should be deleted and side effects applied in sorting:</p><p>- whether a task list becomes a Task if all subtasks deleted</p><p>- When the task is deleted - it should become untimed as well - thus removed from calendar and goes to the bottom of the task/subtask list</p><p>- The task sorting - timed/untimed/deleted</p><p>- Can we treat this as discarded leaf and not show at all?</p><p>- Message when Deleting should say Task not Content.</p><p><br></p><p><br></p>',0,3,0,0,788,0,'publish'),(789,0,1,'1',0,1,'2019-12-26 04:51:30','2019-12-26 04:51:30','<p>Contact -</p><ol><li>Use Expand/collapse and Edit icon for - Hide Details and Edit</li><li>The behavior of these 2 icons - (1) If collapse and edit - then at Save/Cancel - show collapsed view (2) If expanded and edit - after save/cancel - show expanded</li><li>Contact icon not good. it is not clear - is it the resolution?</li><li>We are using 2 different icons - @ and the one in the tree.</li><li><br></li></ol>',0,1,0,0,789,0,'publish'),(790,0,0,'',0,3,'2019-12-26 04:58:46','2019-12-26 05:04:51','<p>meeti